import React, { Component } from 'react';
import './Hero.css'

class Hero extends Component {
    render() {
        return (
            <div id="hero">
                <p>HELLO</p>
                <p id="hero-welcome"><span id="fullstack-text">FULL-STACK</span>SOFTWARE DEVELOPER</p>
            </div>
        );
    }
}

export default Hero;
